import React from 'react'
import cardImage from '../../assets/cardOne.jpg';


function ListCard() {
    const cards = [
        {
          id: 1,
          img: cardImage,
          name: 'Сырная',
          desc: 'Моцарелла, смесь сыров чеддер и пармезан, соус альфредо',
          price: 'от 295 som'
        }
      ];
    
    return (
    <div>
      {cards}
    </div>
  )
}

export default ListCard
